object Solution {
    def canTraverseAllPairs(nums: Array[Int]): Boolean = {
        val n = nums.length
        val parent = Array.tabulate(n)(identity)

        def find(x: Int): Int = if (parent(x) == x) x else {
            parent(x) = find(parent(x))
            parent(x)
        }

        def union(x: Int, y: Int): Unit = {
            val rootX = find(x)
            val rootY = find(y)
            if (rootX != rootY) {
                parent(rootX) = rootY
            }
        }

        def gcd(a: Int, b: Int): Int = if (b == 0) a else gcd(b, a % b)

        for {
            i <- 0 until n
            j <- i + 1 until n
            if gcd(nums(i), nums(j)) > 1
        } union(i, j)

        val root = find(0)
        nums.indices.forall(i => find(i) == root)
    }
}
